import React from "react";
import { Grid, Stack, Typography, Box } from "@mui/material";
import { Container } from "@mui/material";
import Link from "@mui/material/Link";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import style from "../../styles/css/style.css";
import { CommonHeader } from "../../styles/theme";

export default function ProductsList() {
  return (
    <>
      <Container>
        <Grid container spacing={3}>
          <Grid item md={4} sm={12} xm={12} lg={12}>
            <Box component="div" sx={{ paddingY: "10px" }}>
              <CommonHeader>Plans and Products</CommonHeader>
            </Box>
          </Grid>
        </Grid>

        <Grid container spacing={3}>
          <Grid item md={4} sm={6} xm={12} lg={4}>
            <Box component="div" sx={{ paddingY: "20px" }}>
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    image={
                      "https://res.cloudinary.com/dkz3uzlnp/image/upload/v1660729369/food-bang/pexels-mali-maeder-65175_hkspze.jpg"
                    }
                    alt="Order Online"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Order Online
                    </Typography>
                    <Typography variant="body1">
                      Stay Home and order at your doorstep with your loved ones.
                    </Typography>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}
